INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNGO', 'STOCK', 'Bionano Genomics, Inc.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Bionano Genomics, Inc. is a provider of genome analysis solutions that can enable researchers and clinicians to reveal answers to challenging questions in biology and medicine. The Company offers optical genome mapping (OGM) solutions for applications across basic, translational and clinical research. It also offers a platform-agnostic software solution, which integrates sequencing and microarray data designed to provide analysis, visualization, interpretation and reporting of copy number variants, single-nucleotide variants, and absence of heterozygosity across the genome in one consolidated view. The Company additionally offers nucleic acid extraction and purification solutions using proprietary isotachophoresis (ITP) technology. The Company markets and sells OGM systems, including the Saphyr system, which delivers OGM data to enable ultra-sensitive and ultra-specific detection of all classes of structural variation (SV).', 'San Diego, CA, United States', 98);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADEA', 'STOCK', 'Adeia Inc.', 'NMS', 'Technology', 'Software - Application', 'Adeia Inc. is a research and development and intellectual property licensing company. The Company operates as an incubator that invests in advanced research and development to create technologies for the entertainment, media, consumer electronics and semiconductor industries. It invents, develops, acquires, and licenses fundamental innovations that enhance a range of devices and shape the way various people explore and experience entertainment across a variety of platforms. Its solutions are focused on its consumers'' interaction with media, consumer electronics, and entertainment. Its IP licensing platform provides access to innovations that allow its customers, who are media, entertainment, consumer electronics, and semiconductor companies, to create technology solutions and products. It licenses its IP portfolio across markets, such as multichannel video programming distributors, over-the-top video service providers, social media companies, consumer electronics, and semiconductors.', 'San Jose, CA, United States', 150);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDC', 'STOCK', 'Belden Inc.', 'NYQ', 'Technology', 'Communication Equipment', 'Belden Inc. is a global supplier of complete connection solutions. Its Smart Infrastructure Solutions segment is a provider in network infrastructure and broadband solutions, as well as cabling and connectivity solutions for commercial audio/video and security applications. Its vertical markets include data centers, government, healthcare, and hospitality. Its Broadband Solutions primarily serve broadband and wireless service providers. Smart Infrastructure Solutions product lines include copper cable and connectivity solutions, fiber cable and connectivity solutions, interconnect panels, racks and enclosures, and secure, high performance signal extension and matrix switching systems. Its Automation Solutions segment at Belden provides network infrastructure and digitization solutions to enable its customers to make data-based business decisions. Its primary markets include discrete automation, process automation, energy, and mass transit.', 'Saint Louis, MO, United States', 7500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCS', 'STOCK', 'Invesco BulletShares 2028 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2028 (collectively, "2028 Bonds").', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COKE', 'STOCK', 'Coca-Cola Consolidated, Inc.', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Coca-Cola Consolidated, Inc. distributes, markets and manufactures nonalcoholic beverages, primarily products of The Coca-Cola Company. The Company also distributes products to several other beverage companies, including Keurig Dr Pepper Inc. and Monster Energy Company. The Company offers a range of nonalcoholic beverage products and flavors, including both sparkling and still beverages. Sparkling beverages are carbonated beverages, and the Company''s principal sparkling beverage is Coca-Cola. Its still beverages include energy products and noncarbonated beverages such as bottled water, ready to drink tea, ready to drink coffee, enhanced water, juices and sports drinks. Its products are sold and distributed in the United States through various channels, which include selling directly to customers, including grocery stores, mass merchandise stores, club stores, convenience stores and drug stores, and selling to on-premise locations, where products are typically consumed immediately.', 'Charlotte, NC, United States', 15000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZTA', 'STOCK', 'Azenta, Inc.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'Azenta, Inc. É um fornecedor de soluções de ciências da vida em todo o mundo. A empresa fornece um conjunto completo de soluções de gerenciamento de amostras de cadeia fria e serviços multiômicos em áreas como desenvolvimento de medicamentos, pesquisa clínica e terapias celulares avançadas para instituições farmacêuticas, biotecnológicas, acadêmicas e de saúde em todo o mundo. Os segmentos da empresa incluem Sample Management Solutions e Multiomics. Seu segmento de Soluções de Gerenciamento de Amostra oferece produtos e serviços completos de gerenciamento de amostras, incluindo serviços de repositório de amostras e produtos principais (lojas automatizadas, sistemas criogênicos, tubo de amostra automatizado, consumíveis e instrumentos e dispositivos de descongelamento de taxa controlada). O segmento Multiomics da Companhia inclui seu negócio de serviços genômicos, que avança as atividades de pesquisa e desenvolvimento fornecendo sequenciamento genético, síntese, edição e serviços relaci', 'Burlington, MA, United States', 3000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSQ', 'STOCK', 'Calamos Strategic Total Return Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Strategic Total Return Fund is a closed ended balanced mutual fund launched by Calamos Investments LLC. The fund is managed by Calamos Advisors LLC. It invests in the public equity and fixed income markets of the United States. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in common and preferred stocks of companies across all market capitalizations, convertible securities, and high yield corporate bonds with an average credit rating of BB as rated by S&P. The fund employs both fundamental and quantitative analysis with a combination of bottom-up and top-down security picking approaches to create its portfolio. Calamos Strategic Total Return Fund was formed on December 31, 2003 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMCX', 'STOCK', 'AMC Networks Inc.', 'NMS', 'Communication Services', 'Entertainment', 'AMC Networks Inc. is a global entertainment company. The Company creates and curates series and films across distinct brands and makes them available to audiences everywhere. The Companys Domestic Operations segment consists of its five programming networks, its streaming services, its AMC Studios operation and its film distribution business. Its programming networks are AMC, We TV, BBC AMERICA, IFC, and SundanceTV. Its streaming services consist of AMC+ and its targeted subscription streaming services (Acorn TV, Shudder, Sundance Now, ALLBLK, and HIDIVE). Its AMC Studios operation produces original programming for its programming services and third parties and also licenses programming worldwide. Its film distribution business includes Independent Film Company, RLJ Entertainment Films and Shudder. The International segment consists of AMC Networks International (AMCNI), its international programming businesses consisting of a portfolio of channels distributed around the world.', 'New York, NY, United States', 1800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOND', 'STOCK', 'PIMCO Active Bond Exchange-Traded Fund', 'NYQ', NULL, NULL, 'The fund normally invests at least 80% of its assets in a diversified portfolio of Fixed Income Instruments of varying maturities, which may be represented by forwards or derivatives such as options, futures contracts, or swap agreement. It invests primarily in investment grade debt securities, but may invest up to 30% of its total assets in high yield securities, as rated by Moody''s, S&P or Fitch, or, if unrated, as determined by PIMCO.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWP', 'STOCK', 'abrdn Global Premier Properties Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Abrdn Global Premier Properties Fund is a closed-end equity mutual fund launched and managed by Alpine Woods Capital Investors, LLC. It invests in the public equity markets across the globe. The fund invests in stocks of companies operating across real estate sectors. It invests in value stocks of companies. The fund employs fundamental analysis with top-down and bottom-up stock picking approach to create its portfolio. It benchmarks the performance of its portfolio against the FTSE EPRA/NAREIT Global TR Index, MSCI US REIT Gross Total Return Index, and S&P Developed BMI Property Index Net TR Index. Abrdn Global Premier Properties Fund was formed on February 13, 2007 and is domiciled in the United States.', 'Edinburgh, , United Kingdom', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HUSA', 'STOCK', 'Houston American Energy Corp.', 'ASE', 'Energy', 'Oil & Gas E&P', 'Houston American Energy Corp. is a renewable energy company focused on converting waste materials into valuable low-carbon fuels and chemicals. Through its proprietary pyrolysis technology, the Company addresses the global plastic waste crisis while supplying high-demand products like sustainable aviation fuel and recycled feedstocks to the energy and chemical industries. It develops, explores, exploits, acquires, and produces natural gas and crude oil properties. In the United States, the Company''s principal properties and operations are located in the onshore Permian Basin and Gulf Coast region of Louisiana. The Company holds an over 18.1% average working interest in 320 gross acres in Reeves County, Texas. It holds a 15.9% average working interest, subject to a proportionate 10% back-in after payout, in an over 360 gross acre block in Yoakum County, Texas. Its sole property in Louisiana consists of a 23.4% mineral interest in 2,485 gross acres in East Baton Rouge Parish.', 'Houston, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACCO', 'STOCK', 'ACCO Brands Corporation', 'NYQ', 'Industrials', 'Business Equipment & Supplies', 'ACCO Brands Corporation is a global consumer, technology and business branded products company, providing brands and product solutions used in schools, homes and at work. The Company operates through two segments: ACCO Brands Americas and ACCO Brands International. The Americas include the U.S., Canada, Brazil, Mexico and Chile and the International includes EMEA, Australia, New Zealand and Asia. Its primary products include note-taking products, computer and gaming accessories; planners; workspace machines, tools and essentials and dry-erase boards and accessories; filing and organization products; writing and art products and others. Its primary brands include Five Star, PowerA, Tilibra, AT-A-GLANCE, Kensington, Quartet, GBC, Mead, Swingline, Barrilito, Foroni, Hilroy, Leitz, Rapid, Kensington, Esselte, Rexel, PowerA, GBC, NOBO, Franken, Derwent, Marbig, Artline and Spirax. It distributes its products through a variety of channels and sells directly through e-commerce sites.', 'Lake Zurich, IL, United States', 5000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECAT', 'STOCK', 'BlackRock ESG Capital Allocation Term Trust', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELWS', 'STOCK', 'Earlyworks Co., Ltd', 'NCM', 'Technology', 'Software - Application', 'Earlyworks Co Ltd is a Japan-based company mainly engaged in the planning, proposal, design and development of blockchain system solution. The Company is also engaged in the planning, proposal, design and development through unit type semi-order development.', 'Tokyo, , Japan', 20);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSX', 'STOCK', 'Diana Shipping Inc.', 'NYQ', 'Industrials', 'Marine Shipping', 'Diana Shipping Inc. is a Greece-based global provider of shipping transportation services. The Company specializes in the ownership and bareboat charter-in of dry bulk vessels. The Company''s operating fleet consists of 40 dry bulk vessels, including 4 Newcastlemax, 11 Capesize, 5 Post-Panamax, 6 Kamsarmax, 8 Panamax, and 6 Ultramax. Its fleet combined carrying capacity is approximately 4.7 million deadweight tonnage (dwt) with a weighted average age of 10.16 years. The Company''s fleet is managed by its wholly-owned subsidiary Diana Shipping Services S.A. and its established 50/50 joint venture with Wilhelmsen Ship Management named Diana Wilhelmsen Management Limited.', 'Athens, , Greece', 981);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVA', 'STOCK', 'DaVita Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'DaVita Inc. É um fornecedor de cuidados de saúde focado na transformação da prestação de cuidados para melhorar a qualidade de vida dos pacientes em todo o mundo. A Companhia é uma provedora de serviços de assistência renal nos Estados Unidos. Seu negócio de diálise dos Estados Unidos (diálise dos EUA) e serviços de laboratório relacionados trata pacientes com insuficiência renal crônica e doença renal em estágio final (ESKD). A robusta plataforma da empresa oferece serviços de assistência renal e inclui nefrologia e relações de pagamento estabelecidas. As operações internacionais da Companhia prestam serviços de diálise e administrativos a um total de centros ambulatoriais de diálise. O negócio de cuidados renais integrados (IKC) dos EUA da empresa fornece serviços integrados de cuidados e gestão de doenças a pacientes em arranjos de cuidados integrados baseados em risco e a pacientes adicionais em outros arranjos de cuidados integrados em todos os Estados Unidos. Ele também mantém al', 'Denver, CO, United States', 76000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCAT', 'STOCK', 'BlackRock Capital Allocation Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Capital Allocation Term Trust (the Trust) is a diversified, closed-end management investment company. The Trusts investment objectives are to provide total return and income through a combination of current income, current gains and long-term capital appreciation. The Trust invests in a portfolio of equity and debt securities. Generally, the Trusts portfolio will include both equity and debt securities. At any given time, however, the Trust may emphasize either debt securities or equity securities. The Trust utilizes an option writing (selling) strategy in an effort to generate current gains from options premiums and to enhance the Trusts risk-adjusted returns. The Trust can invest in all types of debt securities, including the United States and foreign government bonds, corporate bonds, convertible bonds, municipal bonds, structured notes, credit-linked notes, loan assignments and participations, and others. The Trusts investment adviser is BlackRock Advisors, LLC.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAVA', 'STOCK', 'Endava plc', 'NYQ', 'Technology', 'Software - Infrastructure', 'Endava plc is a technology service provider. The Company provides a combination of product and technology strategies, intelligent experiences, and engineering to help customers become digital, experience-driven businesses by assisting them from idea generation to development and deployment of products, platforms, and solutions. It uses its Distributed Enterprise Agile scaling framework, known as TEAM Enterprise Agile Scaling (TEAS). TEAS helps in designing, developing, and testing digital solutions, providing actionable insights into their business potential. It also provides training for the customers that helps them to develop their technical and soft skills. It serves clients in the payments and financial services, technology, media, and telecom (TMT), consumer products, retail, mobility, and healthcare. The Company also provides outsourced development services across design, engineering and art/animation for PC and console video games and other digital entertainment.', 'London, , United Kingdom', 11365);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASND', 'STOCK', 'Ascendis Pharma A/S', 'NMS', 'Healthcare', 'Biotechnology', 'A Ascendis Pharma A/S é uma empresa com sede na Dinamarca que fabrica produtos farmacêuticos. A empresa produz produtos para os tratamentos de deficiência de hormônio do crescimento, endocrinologia, distúrbios do sistema nervoso central, doenças infeciosas e diabetes. A empresa opera globalmente através de suas subsidiárias: Ascendis Pharma GmbH (Alemanha), Ascendis Pharma, Inc. (Delaware, Estados Unidos), Ascendis Pharma Endocrinology, Inc. (Delaware, Estados Unidos), Ascendis Pharma, Divisão de Oftalmologia A/S (Dinamarca), Ascendis Pharma, Divisão de Endocrinologia A/S (Dinamarca), Ascentis Pharma Doenças Osso A/S (Dinamarca), Ascentis Pharma Distúrbios de Crescimento A/S (Dinamarca) e Ascendis Pharma Oncology Division A/S (Dinamarca).', 'Hellerup, , Denmark', 1017);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COOK', 'STOCK', 'Traeger, Inc.', 'NYQ', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'Traeger, Inc. designs, sources, sells, and supports wood pellet fueled barbecue grills and Flatrock flat top grills sold to retailers, distributors, and direct to consumers. The Company''s integrated platform includes six types of products: wood pellet grills, gas griddles, grilling accessories, digital content, the Traeger app, and consumables. The Company offers eight primary grill lines: Woodridge Series, Timberline Series, Ironwood Series, Pro Series with WiFIRE, Pro Series without WiFIRE, Portable Series, Club Lineup, and Flatrock flat top grill. It offers a variety of Traeger-branded wood pellets, rubs and sauces. It offers a variety of grill accessories, tools to aid in meal prep, cooking, and cleanup, replacement parts, and apparel and merchandise. It produces a library of digital content including instructional recipes and videos that demonstrate tips, tricks, and cooking techniques. The Traeger app is a mobile software application available on iOS or Android devices.', 'Salt Lake City, UT, United States', 665);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETV', 'STOCK', 'Eaton Vance Tax-Managed Buy-Write Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance Tax-Managed Buy-Write Opportunities Fund is a closed-ended equity mutual fund launched and managed by Eaton Vance Management. It is co-managed by Parametric Portfolio Associates LLC. The fund invests in the public equity markets of the United States. It seeks to invest in stocks of companies operating across diversified sectors. The fund also writes call options on one or more U.S. indices on a substantial portion of the value of its common stock portfolio. It benchmarks the performance of its portfolio against the S&P 500 Index, the CBOE S&P 500 BuyWrite Index, the NASDAQ-100 Index, and the CBOE NASDAQ-100 BuyWrite Index. Eaton Vance Tax-Managed Buy-Write Opportunities Fund was formed on June 30, 2005 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGEM', 'STOCK', 'Cullinan Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cullinan Therapeutics, Inc. is a biopharmaceutical company. It has built a diversified portfolio of clinical-stage assets that inhibit key drivers of disease or harness the immune system to eliminate diseased cells in autoimmune diseases and cancer. Its portfolio includes a range of modalities. Its pipeline includes CLN-978, CLN-619, Zipalertinib (CLN-081/TAS6417), CLN-049, and CLN-617. CLN-978 is a CD19xCD3 T cell engager being developed for autoimmune diseases. CLN-619 is a monoclonal antibody that stabilizes expression of MICA/B on the tumor cell surface to promote tumor cell lysis mediated by cytotoxic innate and adaptive immune cells. Zipalertinib (CLN-081/TAS6417) is an orally available small-molecule, irreversible epidermal growth factor receptor inhibitor. CLN-049 is a FLT3xCD3 T cell engaging bispecific antibody. CLN-617 is a fusion protein combining two potent antitumor cytokines, interleukin-2 and interleukin-12 with tumor retention domains for the treatment of solid tumors.', 'Cambridge, MA, United States', 111);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGMH', 'STOCK', 'AGM Group Holdings Inc.', 'NCM', 'Technology', 'Computer Hardware', 'AGM Group Holdings Inc is a technology company engaged in global technology hardware supply chain and fintech blockchain ecosystem. The Companys products and services include: futures trading solution catering to clients using MetaTrader 5; retail-orientated online trading education website; foreign exchange (Forex) trading system that provides services to financial institutions outside of China; technology hardware research and development, manufacture, and sales. The Company operates its businesses in both the United Stated and global markets.', 'Wan Chai, , Hong Kong', 10);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWST', 'STOCK', 'Casella Waste Systems, Inc.', 'NMS', 'Industrials', 'Waste Management', 'Casella Waste Systems, Inc. is a regional, vertically integrated solid waste services company. The Company provides resource management and services to residential, commercial, municipal, institutional, and industrial customers, primarily in the areas of solid waste collection and disposal, transfer, recycling, and organics services. It also holds collection operations across eastern Pennsylvania and western New Jersey. It manages its solid waste operations on a geographic basis through three regional operating segments: the Eastern, Western and Mid-Atlantic regions, each of which provides a comprehensive range of non-hazardous solid waste services. It manages its resource renewal operations through the Resource Solutions operating segment, which leverages its core competencies in materials processing, industrial recycling, organics and resource management service offerings to deliver comprehensive solutions for its commercial, municipal, institutional and industrial customers.', 'Rutland, VT, United States', 5100);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NWS', 'STOCK', 'News Corporation', 'NMS', 'Communication Services', 'Entertainment', 'A News Corporation é uma empresa diversificada de mídia e serviços de informação. Seu segmento de Serviços imobiliários digitais consiste no interesse da Companhia pelo Grupo REA e pela Move. REA Group é uma empresa de mídia digital especializada em imóveis e serviços relacionados à propriedade em seus sites e aplicativos móveis. A Move é uma provedora de serviços imobiliários digitais nos Estados Unidos e opera principalmente uma plataforma de informação imobiliária, publicidade e serviços, bem como seus serviços baseados em referência, ferramentas on-line e serviços para proprietários e inquilinos. Seu segmento Dow Jones consiste na Dow Jones, uma provedora global de notícias e informações de negócios, que distribui seu conteúdo e dados por meio de uma variedade de canais de mídia. Seu segmento de publicação de livros consiste em HarperCollins, uma editora de livros de consumo com operações em 15 países. Seu segmento de mídia de notícias é composto pela News Corp Australia, News UK e', 'New York, NY, United States', 22300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANDE', 'STOCK', 'The Andersons, Inc.', 'NMS', 'Consumer Defensive', 'Food Distribution', 'The Andersons, Inc., is a diversified company. The Company''s segments include Agribusiness and Renewables. The Agribusiness segment includes commodity merchandising, the operation of terminal grain elevator facilities, and the manufacturing and distribution plant nutrient products. The Company''s fertilizer categories include PureGrade, MicroSolutions, soil amendments, organic nutrients, and nitrogen, phosphorus and potash (NPK). Its farmer services include farm centers, originations & farmer risk management - United States, and originations & farmer risk management - Canada. Its merchandising include carbon; corn, beans, wheat, meal; ethanol; export; high-protein feed ingredient; propane and fuel products; fats, oils, and greases; wheat middlings, cottonseed, DDGS, and pet food ingredients. The Renewables segment produces, purchases and sells ethanol and co-products. The segment also operates a merchandising portfolio of ethanol, ethanol co-products and renewable diesel feedstocks.', 'Maumee, OH, United States', 2224);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABOS', 'STOCK', 'Acumen Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Acumen Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is engaged in developing a disease-modifying approach to target underlying cause of Alzheimer''s disease (AD). The Company is focused on advancing a targeted immunotherapy drug candidate, sabirnetug (ACU193), in its Phase II ALTITUDE-AD clinical trial following Phase I results in early AD patients (patients with mild cognitive impairment or mild dementia due to AD). Sabirnetug is a recombinant humanized immunoglobulin gamma 2 (IgG2), monoclonal antibody (mAb) that selectively targets the anti-amyloid-beta oligomer, has demonstrated functional and protective effects in in-vitro assays, and has demonstrated in-vivo safety and pharmacologic activity in multiple animal species including transgenic mouse models for AD. The Company is developing sabirnetug for IV administration once every four weeks (Q4W) for the treatment of early AD, and it has developing sabirnetug for subcutaneous administration.', 'Newton, MA, United States', 61);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDMD', 'STOCK', 'Baird Medical Investment Holdings Limited', 'NCM', 'Healthcare', 'Medical Devices', 'Baird Medical Investment Holdings Ltd is a company mainly engaged in the microwave ablation medical device business. The Company is mainly engaged in the provision of microwave ablation medical device. The medical devices are used for treatment of benign and malignant tumors, including thyroid nodules, liver cancer, lung cancer and breast lumps.', 'Guangzhou, , China', 143);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUSE', 'STOCK', 'First Busey Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'First Busey Corporation is a financial holding company. Its segments include Banking, Wealth Management and FirsTech. Banking segment provides a full range of banking services to individual and corporate customers through its wholly-owned bank subsidiary, Busey Bank. CrossFirst Bankshares, Inc. is also a wholly-owned bank subsidiary of the Company. Wealth Management segment provides a full range of asset management, investment, brokerage, fiduciary, philanthropic advisory, tax preparation, and farm management services to individuals, businesses, and foundations. Wealth management services to individuals include trust and estate advisory services and financial planning; businesses include business succession planning and employee retirement plan services, and foundations include investment strategy consulting and fiduciary services. FirsTech segment provides payment technology solutions and also provides additional tools to help clients with billing, reconciliation and others.', 'Champaign, IL, United States', 1950);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEPU', 'STOCK', 'Central Puerto S.A.', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Central Puerto SA is an Argentina-based company pertaining to the energy sector. The purpose of the Firm is to make investments in the national and international energy market. The Company and its subsidiaries are organized in four different business units, as follows: Electric power generation from conventional sources and its sale; Electric power generation from renewable sources and its sale; Natural gas transport and distribution; Management and operations of thermal plants. The Company operates various wind farms in Argentina such as La Castellana I, Achiras I, La Castellana II, among others.', 'Buenos Aires, , Argentina', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDMT', 'STOCK', '4D Molecular Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', '4D Molecular Therapeutics, Inc. is a late-stage biotechnology company advancing durable and disease-targeted therapeutics. The Company''s lead product candidate 4D-150 is designed to be a backbone therapy forming the foundation of treatment of blinding retinal vascular diseases by providing multi-year sustained delivery of anti-VEGF (aflibercept and anti-VEGF-C) with a single, safe, intravitreal injection, which substantially reduces the treatment burden associated with current bolus injections. Its lead indication for 4D-150 is wet age-related macular degeneration, which is in Phase III development, and second indication is diabetic macular edema. The Company is developing 4D-710 for the treatment of a range of people with cystic fibrosis independent of their specific CFTR mutation. 4D-710 is an investigational genetic medicine candidate using the A101 vector for the treatment of cystic fibrosis lung disease. The Company''s non-core programs include 4D-175, 4D-725, and 4D-310.', 'EmeryVille, CA, United States', 227);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVB', 'STOCK', 'AvalonBay Communities, Inc.', 'NYQ', 'Real Estate', 'REIT - Residential', 'AvalonBay Communities, Inc. É um fundo de investimento imobiliário (REIT). A empresa desenvolve, redesenvolve, adquire e gerencia comunidades de apartamentos em áreas metropolitanas da Nova Inglaterra, na área de metrô de Nova York/Nova Jersey, no meio do Atlântico, no noroeste do Pacífico e no norte e sul da Califórnia, bem como nas regiões de expansão da empresa de Raleigh-Durham e Charlotte, Carolina do Norte, Sudeste da Flórida, Dallas e Austin, Texas, EUA. e Denver, Colorado. A Companhia se concentra nas áreas metropolitanas nessas regiões. Os segmentos da Companhia incluem a mesma Loja, outras Estabilizadas e Desenvolvimento/Redesenvolvimento. A Companhia possui ou detém uma participação direta ou indireta na operação de comunidades de apartamentos contendo casas de apartamentos em 11 estados e no Distrito de Columbia. A empresa opera sob quatro marcas principais, que incluem Avalon, AVA, beirais da Avalon e Kanso. Sua marca principal Avalon se concentra na vida de apartamentos d', 'Arlington, VA, United States', 2928);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVNT', 'STOCK', 'Avient Corporation', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Avient Corporation provides materials solutions. Its portfolio of offerings includes colorants, advanced composites, functional additives, engineered materials, and Dyneema (its ultra-high-molecular-weight polyethylene). Its end markets include consumer, packaging, defense, healthcare, industrial, transportation, building and construction, telecommunications and energy. Its segments include Color, Additives and Inks, and Specialty Engineered Materials. Color, Additives and Inks segment provides specialized custom color and additive concentrates in solid and liquid form for thermoplastics, dispersions for thermosets, as well as specialty inks. Color and additive solutions include an array of colors, special effects and performance-enhancing and sustainable solutions. Specialty Engineered Materials segment provides specialty polymer materials, services and solutions for designers, assemblers and processors of thermoplastic materials across a variety of markets and end-use applications.', 'Avon Lake, OH, United States', 9200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVIR', 'STOCK', 'Atea Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Atea Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on discovering, developing and commercializing oral antiviral therapies to address the unmet medical needs of patients with serious viral infections. The Company has built a proprietary nucleos(t)ide prodrug platform to develop product candidates to treat single-stranded ribonucleic acid (ssRNA) viruses, which are a prevalent cause of serious viral diseases. The Companys lead program and focus is on the development of the regimen of bemnifosbuvir, a nucleotide analog polymerase inhibitor, and ruzasvir, an investigational, potent, small-molecule inhibitor of hepatitis C virus (HCV) non-structural protein 5A (NS5A), an essential protein for HCV replication. Bemnifosbuvir is an investigational, orally administered guanosine nucleotide double prodrug which targets the HCV non-structural protein 5B (NS5B) RNA-dependent RNA polymerase and inhibits HCV replication.', 'Boston, MA, United States', 56);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AYI', 'STOCK', 'Acuity Inc.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Acuity Inc., formerly Acuity Brands, Inc., is an industrial technology company. The Company uses technology to solve problems in space and light. The Company''s segments include Acuity Brands Lighting (ABL) and Acuity Intelligent Spaces (AIS). The Company offers various products and services, including lighting, lighting controls, building management solutions, and an audio, video and control platform. It operates across North America, Europe and Asia.', 'Atlanta, GA, United States', 13200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWLP', 'STOCK', 'BW LPG Limited', 'NYQ', 'Industrials', 'Marine Shipping', 'BW LPG Limited is a Singapore-based owner and operator of liquefied petroleum gas (LPG) vessels, owning and operating gas carriers (VLGCs) with a total carrying capacity of over four million CBM (Cubic Meter). The Company''s business includes LPG shipping, product services and infrastructure. It owns and operates a fleet of LPG-powered VLGCs. Its VLGCs are retrofitted with LPG dual-fuel propulsion technology. It provides customers with integrated LPG delivery services. It is focused on its downstream terminal infrastructure and LPG distribution, as its core shipping business serves its customers with VLGCs, and its in-house product services team purchases LPG and delivers it directly to buyers and/or receivers. It owns and operates a total of over 54 VLGCs, of which 29 are LPG dual-fuel, solidifying the Companys position as owner and operator of VLGCs, and that of the dual-fuel-powered VLGCs. Its owned VLGCs include BW Aries, BW Balder, BW Chinook and BW Gemini, among others.', 'Singapore, , Singapore', 1429);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLH', 'STOCK', 'Clean Harbors, Inc.', 'NYQ', 'Industrials', 'Waste Management', 'Clean Harbors, Inc. is a provider of environmental and industrial services. The Company delivers a range of services, such as end-to-end hazardous waste management, emergency spill response, industrial cleaning and maintenance, and recycling services. Its Environmental Services segment offers an array of services to customers. It collects, transports, treats and disposes of hazardous and non-hazardous waste through its network of waste disposal facilities, including incinerators, landfills, treatment, storage and disposal facilities (TSDFs), wastewater treatment facilities and solvent recycling centers. Its Safety-Kleen Sustainability Solutions (SKSS) segment offerings span the lifecycle of sustainable lubricant products. It collects used oil which serves as feedstock for its oil re-refineries. At these facilities, it manufactures, formulates and packages lubricants which are returned to the marketplace. It also provides parts washers and environmental services to various customers.', 'Norwell, MA, United States', 22796);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADV', 'STOCK', 'Advantage Solutions Inc.', 'NMS', 'Communication Services', 'Advertising Agencies', 'Advantage Solutions Inc. is a provider of business solutions to consumer goods manufacturers and retailers. It offers a platform of quality omni-channel services, such as brokerage (headquarter sales), retail merchandising, in-store sampling and private brand development. Its segments include Branded Services, Experiential Services, and Retailer Services. The Branded Services segment offers capabilities in brokerage, branded merchandising and omni-commerce marketing services to consumer goods manufacturers. The Experiential Services segment expands the reach of consumer brands and retailer products to convert shoppers into buyers through sampling and product demonstration programs executed in-store and online. The Retailer Services segment provides retailers with end-to-end advisory, retailer merchandising, and agency expertise to drive sales. It provides retailers with an end-to-end solution, including private brand strategy, merchandising, retail media and aisle/shelf optimization.', 'Clayton, MO, United States', 17000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCIF', 'STOCK', 'Carlyle Credit Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Carlyle Credit Income Fund is a close ended fixed income mutual fund launched and managed by Vertical Capital Asset Management, LLC. The fund is co - managed by Behringer Advisors, LLC. The Fund invests mainly in fixed-income securities. The fund invests in stocks of companies operating across diversified sectors. It seeks to benchmark the performance of its portfolio against the Barclays Capital U.S. Mortgage Backed Securities Index. Carlyle Credit Income Fund was formed on December 30, 2011 and is domiciled in the United States.', 'Dallas, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEC', 'STOCK', 'Diversified Energy Company PLC', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'Diversified Energy Company PLC is an energy company focused on natural gas and liquids production, transport, marketing, and well retirement. It has onshore upstream and midstream assets. Its assets are primarily located within the Appalachian and Central regions of the United States. The Appalachian Region spans Pennsylvania, Virginia, West Virginia, Kentucky, Tennessee and Ohio and consists of two productive unconventional shale formations, along with numerous conventional formations. It operates within the Marcellus Shale and the slightly deeper Utica Shale, as well as many conventional formations. Its Central Region includes parts of Texas, Louisiana and Oklahoma, and is home to a number of asset rich natural gas and oil formations. It operates within the Haynesville, Bossier, Cotton Valley, Barnett and Mid Continent plays. It has a Permian asset base with multiple zones in the Northern Delaware Basin. Its subsidiary, Next LVL Energy LLC, is an asset retirement service provider.', 'Birmingham, AL, United States', 1589);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DH', 'STOCK', 'Definitive Healthcare Corp.', 'NMS', 'Healthcare', 'Health Information Services', 'Definitive Healthcare Corp. is engaged in transforming data, analytics, and expertise into healthcare commercial intelligence. The Companys solutions are designed to provide information on healthcare providers and their activities to help its customers optimize everything from product development to go-to-market planning and sales and marketing execution. Its software-as-a-service (SaaS) platform uses deep analytics and data science to help customers develop data-driven strategic decisions, such as finding new markets to enter, building comprehensive go-to-market strategies, accessing tactical information to help target the right decision makers and improving win rates with detailed contextual information. It transforms data into intelligence through artificial intelligence (AI) and machine learning (ML) algorithms that ingest, cleanse, link, and analyze the data to create new intelligence and analytics. Its business is conducted through AIDH TopCo, LLC (Definitive OpCo).', 'Framingham, MA, United States', 782);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADX', 'STOCK', 'Adams Diversified Equity Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Adams Diversified Equity Fund, Inc. is a publicly owned investment manager. It primarily provides its services to investment companies. The firm is a large advisory firm The firm is actively engaged in businesses, including commodity pool operator or commodity trading advisor. The firm launches equity. NA The firm employs combination of fundamental, technical, quantitative modelling, and macro-economic analysis to make its investment. The firm conduct external research to make its investment. The firm was formerly known as The Adams Express Company. Adams Diversified Equity Fund, Inc. was founded in 1929 and is based in Baltimore, Maryland.', 'Baltimore, MD, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMA', 'STOCK', 'Banco Macro S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco Macro SA is an Argentina-based public company that offers traditional banking products and services to companies, including those operating in regional economies, and individuals, thus strengthening its goal to operate as a multiservice bank. Through other companies in the group, the Company also renders services as trustee agent and director and manager of mutual funds, as well as stock exchange services. The Company began the process of acquiring entities, assets and liabilities as part of the privatization of provincial banks and other banking institutions. The Company and Worldline Argentina SA entered into a joint venture agreement with Siemens Itron Business Servicies SA, to be jointly controlled by both companies, for the purpose of facilitating the development of a tax management data processing center, modernizing the existing tax collection systems and processes used by the Province of Salta, and managing and recovering municipal taxes and fees.', 'Buenos Aires, , Argentina', 8903);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFXT', 'STOCK', 'Enerflex Ltd.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Enerflex Ltd. is a Canada-based integrated global provider of energy infrastructure and energy transition solutions, delivering natural gas processing, compression, power generation, refrigeration, cryogenic, and produced water solutions. The Company''s North America segment is engaged in manufacturing natural gas infrastructure under contract, refrigeration, processing, and electric power equipment, including custom and standard compression packages and modular natural gas processing equipment, refrigeration systems and produced water treatment services. Its Latin America segment operates its energy infrastructure assets under take-or-pay contracts, providing after-market services. The Company''s Eastern Hemisphere segment operates its energy infrastructure assets under take-or-pay contracts, manufacturing, after-market services, including parts and components, as well as operations, maintenance, and overhaul services, and rentals of compression and processing equipment.', 'Calgary, AB, Canada', 4600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLCO', 'STOCK', 'Cool Company Ltd.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Cool Company Ltd. is a liquefied natural gas (LNG) carrier pure play with a portfolio of short and longer-term charters. Through its in-house vessel management platform, it manages and operates its LNG transportation and infrastructure assets for a range of companies in addition to providing such services to third parties. Its fleet consists of about nine tri-fuel diesel electric (TFDE) LNG carriers (LNGCs), namely the Kool Husky, Kool Crystal, Kool Frost, Kool Glacier, Kool Ice, Kool Kelvin, Kool Blizzard, Kool Boreas and Kool Baltic; two modern two-stroke namely the Kool Orca and the Kool Firn; and two newbuild two-stroke LNGCs namely the Kool Panther and Kool Tiger (Newbuild Vessels). In addition to its fleet, it is also engaged in managing vessels owned by third parties. It manages LNGCs and floating storage and regasification units (FSRUs). It provides the services of its owned ships under time charters. Its customers are LNG producers, commodity traders and end users.', 'London, , United Kingdom', 94);\n
